<!DOCTYPE html>
<html id="a">
<head>
<script>
  function getURLParameter(name) {
    return decodeURIComponent((new RegExp('[?|&]' + name + '=' + '([^&;]+?)(&|#|;|$)').exec(location.search)||[,""])[1].replace(/\+/g, '%20'))||null;
  }
  window.keyvalid=0
  function load() {
    document.open()
    if(!(getURLParameter("key"))) {
      document.write("({NO})")
    } else {
      switch(getURLParameter("key")) {
        case "AAAAAFKEKTROPMMDL":
          document.write("({YES})")
          window.keyvalid=1
      }
      if(window.keyvalid == 0) {
        document.write("({NO})")
      }
    }
  }
  document.getElementById("a").innerHTML = ""
  load();
</script>
</head>
</html>
